pragma solidity ^0.8.0;

import "./ElvateChest.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

/// @author aussedatlo
/// @title Elvate Fee
abstract contract ElvateFees is Ownable, ElvateChest {
    using SafeERC20 for IERC20;

    uint256 public pairCreationFee = 10**16; // fee of 0.1
    uint256 public swapFee = 5; // 0.05%

    constructor(address _WBNBAddress) ElvateChest(_WBNBAddress) {}

    /// @dev deduct fees and distribute them to contract and sender
    /// @param _totalAmountOut total amount of token purchased
    /// @param _tokenOut address of token out
    /// @return Total aamount out after fees
    function _deductFees(uint256 _totalAmountOut, address _tokenOut)
        internal
        returns (uint256)
    {
        uint256 fees = SafeMath.div(
            SafeMath.mul(_totalAmountOut, swapFee),
            10000
        );

        // Take one part for contract
        tokens[_tokenOut][address(this)] = SafeMath.add(
            tokens[_tokenOut][address(this)],
            fees
        );

        // and other part for sender
        IERC20(_tokenOut).safeTransfer(msg.sender, fees);

        return SafeMath.sub(_totalAmountOut, SafeMath.mul(fees, 2));
    }

    /// @dev update pair creation fee
    function updatePairCreationFee(uint256 _fee) external onlyOwner {
        pairCreationFee = _fee;
    }

    /// @dev update swap fee
    function updateSwapFee(uint256 _fee) external onlyOwner {
        require(swapFee <= 5, "fees too hight");
        swapFee = _fee;
    }

    /// @dev retrieve all specific token fees
    function withdrawTokenFees(address _tokenOut) external onlyOwner {
        IERC20(_tokenOut).safeTransfer(
            msg.sender,
            tokens[_tokenOut][address(this)]
        );
        tokens[_tokenOut][address(this)] = 0;
    }

    /// @dev retrieve all BNB fees
    function withdrawFees() external onlyOwner {
        payable(msg.sender).transfer(address(this).balance);
    }
}

